import React from 'react';
import { connect, useDispatch } from "react-redux";
import ButtonLink from '../../UserInterface/Buttons/Button/ButtonLink';
import { startGetRequestServer } from '../../store/serverViewType/actions/actionViewType';
import iceBaikal from '../../image/iceBaikal.jpg';
import { NavLink } from 'react-router-dom';


function Header() {

    const dispatch = useDispatch();

    return (
        <header>
            <nav>
                <NavLink
                    to='/'
                >
                    <img src={iceBaikal} width="50" height="50" alt="iceBaikal" />
                </NavLink>
                    <ButtonLink
                        to='/'
                        name='Home'
                        onclick={() => console.log("GO HOME")}
                        classname=''
                        tabIndex='1'
                    />
                    <ButtonLink
                        to='/ViewType'
                        name='ViewType'
                        onclick={() => { dispatch(startGetRequestServer()) }}
                        classname=''
                        tabIndex='2'
                    />
                        <ButtonLink
                        to='/EltypeClass'
                        name='EltypeClass'
                        onclick={() => console.log("EltypeClass")}
                        classname=''
                        tabIndex='3'
                    />

            </nav>
        </header>
    )
}
export default connect()(Header)
